import '../css/nav.css';
import { React, useState, useContext, useEffect } from 'react';
import { Navbar, Nav} from 'react-bootstrap';
import { Account } from "../cognito/Account";
import { AccountContext } from "./Account";


const NavigationBar = () => {
        const [status, setStatus] = useState(false);

        const { getSession, logout } = useContext(AccountContext);

        useEffect(() => {
          getSession().then((session) => {
            console.log("Session: ", session);
            setStatus(true);
          });
        }, []);

        return(
            <Navbar className ="navbar">
                <Navbar.Brand href="/" className = "navbrand">Customized Newsfeed</Navbar.Brand>
                    <Nav className="action-box">
                        {status ? <button onClick={logout}>LogOut</button> : <div>
                            <Nav.Link eventKey ="1"  href="/sign-up">Sign up</Nav.Link>
                            <Nav.Link  eventKey="2" href="/sign-in">Login</Nav.Link></div>
                        }
                    </Nav>
            </Navbar>

       );

}
export default NavigationBar;
